///////////// Código do App para o exercicio de fixação sobre composição de componentes

// O componente App é o pai do componente Order - Order é uma parte pequena do componente maior App

// arquivo App.js, criado pelo create-react-app, modificado
import React from 'react';
import './App.css';
import Order from './Order';

class App extends React.Component {
  render() {
    const headphone = {
      id: 102,
      user: "cena@gmail.com",
      product: "Razer Headphone",
      price: {
        value: 99.99,
        currency: "dollars"
      }
    };

    const energyDrink = {
      id: 77,
      user: "cena@gmail.com",
      product: "Monster 500mL",
      price: {
        value: 9.99,
        currency: "dollars"
      }
    };

    return (
      <div className="App">
        <h1> Orders recently created </h1>
         <Order
            user={ headphone.user }
            product={ headphone.product }
            price={ headphone.price.value }
          />
         <Order
            user={ energyDrink.user }
            product={ energyDrink.product }
            price={ energyDrink.price}
         />
      </div>
    );
  }
}

export default App;
